Sample code:

        static void Main(string[] args)
        {
            try
            {
                DataTable table = null;
                string flatExcelFile = @"d:\CsvHelperClass\sample\sample.xlsx";
                string config = File.ReadAllText(@"d:\CsvHelperClass\sample\mapper_otp_xls.xml");

                var flatExcelHelper = new FlatExcelHelper();
                var fileExt = Path.GetExtension(flatExcelFile).ToLower();

                string[] flatExts = { ".csv", ".txt" };
                string[] excelExts = { ".xls", ".xlsx" };

                if (flatExts.Contains(fileExt))
                    table = flatExcelHelper.ReadFlat(flatExcelFile, ref config);
                else if (excelExts.Contains(fileExt))
                    table = flatExcelHelper.ReadExcel(flatExcelFile, ref config);

                foreach (DataRow dr in table.Rows)
                {
                    Console.WriteLine(string.Format("{0} - {1} - {2} - {3}", dr.ItemArray));
                }

                if (flatExts.Contains(fileExt))
                { 
                    string result = flatExcelHelper.WriteFlat(ref table, ref config);
                    Console.WriteLine(result);
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine($"Error: {ex.Message}");
            }
            finally
            { 
                Console.ReadKey();
            }
        }

FeedPackage.Description:
Sample usages:

          using (var session = new TemporarySession())
          {
                var testObject = new TestDoc { Text = "hello world" };

                var result = session.Get<TestDoc>("test");

                Assert.That(result, Is.Null);

                var info = session.Save(testObject, "test");

                testObject.Text = "hello world chagned";

                session.Save(testObject);

                testObject.Text = "hello world changed";

                info = session.Save(testObject);

                testObject.Text = "hello world changed 2";

                session.Save(testObject, info);

                session.Delete(testObject);

                result = session.Get<TestDoc>("test");

          Assert.That(result, Is.Null);
          }

          also supports some design document helpers (views and updates)
          e.g.
            session.Design("test").ViewDocs<TestDoc>("test", track: true);
            string result = session.Design("test").Update<TestDoc, string>("test", testObject);

FeedPackage.Summary:
A simple library for interacting with couch db. Supports tracking of documents and automatic updating of a javascript based design documents.
And a design view query helper for e.g. session.Design("test").ViewDocs<TestDoc>("test", track: true);
which whould run the _design/test/view/test view with include_docs=true and map then to the TestDoc object. The objects would also be tracked to allow save / delete operations.

